import {getConnection} from "../database/database";
import bcrypt from 'bcrypt';
import cookieParser from "cookie-parser";
const saltRounds = 10;

const register = async (req, res) => {
    try{
        const {name, email, passworduser } = req.body;
        if(name===undefined || email===undefined || passworduser===undefined){
            res.status(400).json({ message: "Bad Request. Please fill all field."})
        }
        const salt = bcrypt.genSaltSync(saltRounds);
        const password = bcrypt.hashSync(passworduser.toString(), salt);
        const user = { name, email, password};
        const connection= await getConnection();
        await connection.query("INSERT INTO users SET ?", user);
        return res.json({Status: 'Success'});

    }catch(error){
        res.status(500);
        res.send(error.message);

    }

};

const login = async (req, res) => {
    try{
        console.log('hola');
        const { email, passworduser } = req.body;
        if(email===undefined || passworduser===undefined){
            res.status(400).json({ message: "Bad Request. Please fill all field."})
        }
        const user = { email, passworduser};
        const connection= await getConnection();
        await connection.query("SELECT * FROM users WHERE email = ?", user.email, (err, data) => {
            if(err) return res.json({Error: "Login error in server"});
            if(data.length > 0) {
                bcrypt.compare(user.passworduser.toString(), data[0].password, (err, response) => {
                    if(err) return res.json({Error: "Password compare error"});
                    if(response) {
                        return res.json({Status: "Success"});
                    }else {
                        return res.json({Error: "Password not matched"});
                    }
                })
            }else {return res.json({ Error: "No email existed"})}
        });
        return res.json({Status: 'Success'});

    }catch(error){
        res.status(500);
        res.send(error.message);

    }

};

export const methods = {
    register, login
};

